import React from "react";
import Home from "./Home"
import styled from 'styled-components/macro';


const BannerImage = styled.img``;
const Rooms = (image , alt) => {
  return (
    <>

     <BannerImage src={image} alt={alt} />
    </>
  );
};

export default Rooms;
